import Logo from './logo.png';
import {
  Nav,
  NavLink,
  Bars,
  NavMenu,
  NavBtn,
  NavBtnLink,
  NavLogo
} from './elements';
import '.index.css';

const Navbar = () => {
  <>
    <nav className="navbar navbar-expand-md">
      <a className="navbar-left" href='/'>
        <img src="logo-no-text.png" className="logo-img" alt="Radha Patel logo" />
        <span className="logo-text"><strong>Radha Patel</strong></span>
      </a>
      <button className="navbar-toggler navbar-dark" type="button" data-toggle="collapse" data-target="#main-navigaton">
        <span className="navbar-toggler-icon"></span>
      </button>

      <div className="collapse navbar-collapse" id="main-navigation">
        <ul className="navbar-nav">
          <li className="nav-item active">
            <a className="nav-link" href='/'>Home</a>
            <span className="sr-only">(current)</span>
          </li>
          <li className="nav-item">
            <div className="dropdown">
              <a className="nav-link" href="projects.html">
                <button className="dropbtn" href="projects.html">Projects
                  <i className="fa fa-caret-down"></i>
                </button>
              </a>
              <div className="dropdown-content">
                <a className="nav-link" href="invaders.html">Alien Invaders</a>
                <a className="nav-link" href="maze_runner.html">Maze Runner</a>
                <a className="nav-link" href="scheduler.html">Cornell Scheduler</a>
                <a className="nav-link" href="refugee_analysis.html">Refugee Data Analysis</a>
              </div>
            </div>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="#">Resume</a>
          </li>
          <li className="nav-item">
            <div>
              <a className="nav-link" href="https://wordsforthought22.wordpress.com/" target="_blank">Blog</a>
            </div>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="contact.html">Contact</a>
          </li>
        </ul>
      </div>
    </nav>
  </>
}

export default Navbar;

